import React from 'react';
import Navbar from './Navbar';
import './Home.css';
import Footer from './footer';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel } from 'react-bootstrap';
import image1 from '../images/image1.jpeg';
import image2 from '../images/image2.jpg';
import image3 from '../images/image3.jpeg';
import image4 from '../images/image4.jpeg';
import image5 from '../images/image5.jpeg';

function Home() {
  return (
    <div className="home-container">
      <h2 className="text-center">Welcome to the Home Page</h2>
      <br />
      <div className="row py-3">
        <div className="col">
          <Carousel  >
            <Carousel.Item>
              <img className="carousel-image" src={image1} alt="Image 1" />
              <Carousel.Caption>
                <h3>Image 1</h3>
              </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
              <img className="carousel-image" src={image2} alt="Image 2" />
            </Carousel.Item>
            <Carousel.Item>
              <img className="carousel-image" src={image3} alt="Image 3" />
            </Carousel.Item>
            <Carousel.Item>
              <img className="carousel-image" src={image4} alt="Image 4" />
            </Carousel.Item>
            <Carousel.Item>
              <img className="carousel-image" src={image5} alt="Image 5" />
            </Carousel.Item>
          </Carousel>
        </div>
      </div>
      <Navbar className="navvv" />
      <Footer />
    </div>
  );
}

export default Home;
